Hallo! Mein Name ist Bastian und ich m&ouml;chte Ank&uuml;ndigen, dass ich Leute die in Bronze und Silber h&auml;ngen aus der Elo Hell rausholen m&ouml;chte! {{summoner:13}} 

Alle die Interesse haben aus den unteren Divisionen zu kommen sollen sich hier melden und oder auf Skype (wayfinder163)

Wir reden dann, wie ihr mir im Gegenzug helfen k&ouml;nnt!{{champion:115}} 

Vielleicht bis bald, euer Bastian!
